I used to get called Eyeliner Boy at primary school. I thought it was really nasty and sometimes recount that story about how brutal little kids are. 

Over the past 24 hours, for the first time in many years, people are calling me that again after my keynote speech at the World Internet Forum.

A lot of bitter people have come out of the woodwork, and I’m really glad I’m not 7 anymore ‘cos now I see it from an adult’s eyes and I actually think it shows I’m doing something right. 

Just to make the haters a bit more bitter, I have to add that there is so much more I experienced at the conference, including: 

🟡Having lunch with the CEO and senior management of Bilibili — probably China’s most popular video sharing app — who invited me to host the round table discussion on their behalf;

🟡Having dinner and an awesome chat with the man who edited the English version of Xi Jinping’s The Governance of China series;

🟡Making new friends and connections with other new media journalists in China;

🟡Meeting a simultaneous translator working at the event who happened to walk past and struck up a conversation about how much he appreciates my Reports on China series and how it helps with his work, and so much more! 

I’m not 7 anymore, but sometimes I do wish I could tell the younger me not to feel down about bullying, and just to keep his head up and keep going. 

Bring it on!
